import React from "react";
import Header from "./Header";
import Productos from "./Productos";
class PrimerComponenete extends React.Component {
    render() {
        return (
            <div>
                <Header/>
                <h1>Tienda virtual</h1>
                <Productos/>
            </div>
        )
    }
}
export default PrimerComponenete
